fn imp (builder : & StartBytesBuilder) -> Option < Prefilter > { if builder . count > 3 { return None ; } let (mut bytes , mut len) = ([0 ; 3] , 0) ; for b in 0 .. 256 { if ! builder . byteset [b] { continue ; } if b > 0x7F { return None ; } bytes [len] = b as u8 ; len += 1 ; } let finder : Arc < dyn PrefilterI > = match len { 0 => return None , 1 => Arc :: new (StartBytesOne { byte1 : bytes [0] }) , 2 => { Arc :: new (StartBytesTwo { byte1 : bytes [0] , byte2 : bytes [1] , }) } 3 => { Arc :: new (StartBytesThree { byte1 : bytes [0] , byte2 : bytes [1] , byte3 : bytes [2] , }) } _ => { :: core :: panicking :: panic ("internal error: entered unreachable code" ,) } } ; Some (Prefilter { finder , memory_usage : 0 , }) }